import React, { Component } from 'react';

class About extends Component {
    render() {
        return (
            <div className="container">
                <h1 className="about">About Me</h1>
                <br></br><br></br>
                <h4>First off, thanks for visiting my page!</h4>
                <br></br><br></br>
                <h1><strong>I'm a college senior majoring in computer science.</strong></h1>
                <h4 style={{ paddingTop: '10px' }}>I'm currently looking for internships involving software and/or full stack development.</h4>
                <h4 style={{ paddingTop: '10px' }}>However, I'm always open to new opportunities, so feel free to contact me for unrelated roles (or if you just want to chat).</h4>
            </div>
        );
    }
}

export default About;
